@section('scripts')
   <script src="{{ asset('vendor\ckeditor\ckeditor.js') }}"></script>
   <script src="https://unpkg.com/jspdf@latest/dist/jspdf.min.js"></script>

   <script>

      function loadFont() {
         //(1)get css as a text.
         console.log('start load')
         const request = new XMLHttpRequest();
         request.open("get", "https://fonts.googleapis.com/css?family=Open+Sans");
         request.responseType = "text";
         request.send();
         request.onloadend = () => {
                  
               //(2)find all font urls.
               let css = request.response;
               const fontURLs = css.match(/https?:\/\/[^ \)]+/g);
               let loaded = 0;
               console.log(fontURLs)
               fontURLs.forEach(url => {
                        
                  //(3)get each font binary.
                  const request = new XMLHttpRequest();
                  request.open("get", url);
                  request.responseType = "blob";
                  request.onloadend = () => {
                  
                  //(4)conver font blob to binary string.
                  const reader = new FileReader();
                  reader.onloadend = () => {
                     //console.log(css)
                     //(5)replace font url by binary string.
                     css = css.replace(new RegExp(url), reader.result);
                     loaded++;
                     //check all fonts are replaced.
                     if(loaded == fontURLs.length){
                     console.log("22")
                              $('svg').prepend(`<style>${css}</style>`);                
                     }
                  };
                  reader.readAsDataURL(request.response);
                  };
                  request.send();
               });
         };
      }         

      function DownloadCertificate()
      {

         var svgString = new XMLSerializer().serializeToString(document.querySelector('svg'));
         
         var canvas = document.getElementById("canvas");
         var ctx = canvas.getContext("2d");   
         var DOMURL = self.URL || self.webkitURL || self;
         var img = new Image();
         var svg = new Blob([svgString], {type: "image/svg+xml;charset=utf-8"});
         var url = DOMURL.createObjectURL(svg);
         img.onload = function() {
            ctx.drawImage(img, 0, 0);
            var png = canvas.toDataURL("image/png", 0.9);                
            var pp = document.createElement('a');
            pp.setAttribute('href', png);
            pp.setAttribute('download', 'certificado_{{ $assignment->code }}');                
            pp.click();

            var imgData = png;
            var doc = new jsPDF('l', 'px', [706, 521]);
            doc.addImage(imgData, 'JPEG', 0, 0, 0, 0);         
            doc.save('certificado_{{ $assignment->code }}'+'.pdf');

         };
         img.src = url;
      }

      $(() => {
         loadFont();
         CKEDITOR.replace('editor');
      })

   </script>    
